import './App.css';
// import { Parallax } from 'react-parallax';
import ImageFadeIn from "react-image-fade-in";
import { NaviBarComponent } from './components/NavigationBar';
import Typewriter from "typewriter-effect";
import ParticlesComponent from './components/Particles';


function App() {
  return (
    <div className="App">
      <NaviBarComponent />
      <header className="App-header">
        <ImageFadeIn opacityTransition='5' src='https://pbs.twimg.com/profile_images/1409628661486133248/Ne-x4N7D_400x400.jpg' className="App-logo" alt="logo" />
      </header>

      <ParticlesComponent className='particles'/>

      <div className='typer'>
        <Typewriter onInit={(typewriter) => {
          typewriter

            .typeString("hi i'm gurjit")
            .pauseFor(4000)
            .typeString(" ਗੁਰਜੀਤ")
            .pauseFor(3000)
            .deleteAll()
            .typeString("welcome to my portfolio")
            .start();
        }}
        />
      </div>
      {/* <br /><br /><br /><br /><br /> */}
      <div className='parallaxBox'>
        <Parallax className='mr-auto' strength={200} renderLayer={(percentage) => (
          <div>
            <div
              style={{
                position: "absolute",
                marginLeft: "50%",
                borderRadius: "50%",
                left: "50%",
                top: "50%",
                margin: "auto",
                transform: "translate(-50%,-50%)",
                width: percentage * 500,
                height: percentage * 500,
                backgroundImage: "url('https://pbs.twimg.com/profile_images/1409628661486133248/Ne-x4N7D_400x400.jpg')",
                border: "lavender 5px solid"
              }}
            />
          </div>
        )}
        >
          <div className='insideStyles' style={{ height: 539 }} />
          <p>Gurjit is an aspiring software developer currently studying at the University of Maryland - College Park.</p>
        </Parallax>
      </div>
    </div>
  );
}

export default App;
